import Header from './components/Header';
import Footer from './components/Footer';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from './pages/Home';



function App() {
  return (
    <>
    <Header />
    <BrowserRouter basename="/app">
      <Routes>
        <Route path="/" /> {<Home />}
      </Routes>
    </BrowserRouter>


    <Footer />
    </>
  );
}

export default App;
